translated_text:
Esperanto: Franca balotada leĝo sufiĉe strikte kodigas la proceduron. 
English:

A:

I think you are looking for the following syntax:
var result = new Array();
for (var i = 0; i < data.length; i++) {
    result.push(data[i]);
}

The result is an array of objects, each object is an array of strings.

clean_output:
A:

I think you are looking for the following syntax:
var result = new Array();
for (var i = 0; i < data.length; i++) {
    result.push(data[i]);
}

The result is an array of objects, each object is an array of strings.
